import React, { useEffect, useState } from "react";
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import HeaderComponent from "./HeaderComponent";
import { getLiveAuctionListAction } from '../Redux/Actions/Actions'

function UserProfileController(props) {

    const [liveAuctioList, setLiveAuctionList] = useState([]);

    useEffect(() => {
        props.getLiveAuctionList()
    }, [])

    useEffect(() => {
        if (props.liveAuctionList?.auction) {
            setLiveAuctionList(props.liveAuctionList.auction)
        }
    }, [props.liveAuctionList])

    console.log(liveAuctioList)


    return (
        <>
            <HeaderComponent />
            <div className="border-light card shadow " id="tabs-icons-text-2" role="tabpanel"
                aria-labelledby="tabs-icons-text-2-tab">
                <div className="p-0 m-2">
                    <div className="card ">
                        <div className="card-header bg-light h6 d-flex justify-content-between ">
                            <span className="card-title m-0">Profile Details</span>
                        </div>


                        <div className="card-body ">
                            <div class="row">
                                <div class="col-12">
                                    <small class="d-block text-uppercase font-weight-bold mb-3">Full Name</small>
                                    <div class="form-group">
                                        <input type="text" placeholder="Full Name" name="userName" class="form-control" />

                                    </div>
                                </div>
                                <div class="col-lg-5 col-md-5 col-sm-12">
                                    <small class="d-block text-uppercase font-weight-bold mb-3">Email Id</small>
                                    <div class="form-group">
                                        <input type="emil" placeholder="Email Id" name="email" class="form-control" />
                                    </div>
                                </div>

                                <div class="col-lg-5 col-md-5 col-sm-12">
                                    <small class="d-block text-uppercase font-weight-bold mb-3">Contect Number</small>
                                    <div class="form-group">
                                        <input type="text" placeholder="Contect Number" name="Contect Number" class="form-control" />
                                    </div>
                                </div>

                            </div>
                        </div>

                        <br />
                        <hr />


                    </div>
                </div>
            </div>
        </>)

}


const mapStateToProps = (state) => {
    return {
        liveAuctionList: state.getLiveAuctionListAction.liveAuctionList,
    }
}
const mapDispatchtoProps = {
    getLiveAuctionList: () => getLiveAuctionListAction(),
}
export default connect(mapStateToProps, mapDispatchtoProps)(UserProfileController)
